const startDate = new Date()
const endDate = new Date()

export async function fetchData() {
  const response = await fetch(`/api/jobs-views/GetMetaData?startDate=${startDate.ToString("O")}&endDate=${endDate.ToString("O")}`)
  const data = await response.json()
  return data.result;
}
